function ContactUs() {
  return (
    <>
    <Navbar/>
    {/* <div style={{ maxWidth: '600px', margin: '0 auto', padding: '60px' }}>
      <h1 style={{ textAlign: 'center' }}>Contact Us</h1>

      <form style={{ marginTop: '90px' }}>
        <label htmlFor="name">Name:</label><br />
        <input type="text" id="name" name="name" style={{ width: '100%', padding: '10px', marginBottom: '10px' }} /><br />

        <label htmlFor="email">Email:</label><br />
        <input type="email" id="email" name="email" style={{ width: '100%', padding: '10px', marginBottom: '10px' }} /><br />

        <label htmlFor="message">Message:</label><br />
        <textarea id="message" name="message" style={{ width: '100%', padding: '10px', marginBottom: '10px' }} rows="5"></textarea><br />

        <button type="submit" style={{ padding: '10px 20px', backgroundColor: 'palevioletred', color: 'white', border: 'none', cursor: 'pointer' }}>Submit</button>
      </form>

    </div> */}
 <div className="Contact-container">
      <main className="row">

        {/* Left Section (Column) Starts */}
        <section className="col left">

          {/* Title Starts */}
          <div className="contactTitle">
            <h2>Get In Touch</h2>
            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod.</p>
          </div>
          {/* Title Ends */}

          {/* Contact Info Starts */}
          <div className="contactInfo">
            <div className="iconGroup">
              <div className="icon">
                <i className="fa-solid fa-phone"></i>
              </div>
              <div className="details">
              <span>Phone</span>
                <span>+00 110 111 00</span>
              </div>
            </div>
            <div className="iconGroup">
              <div className="icon">
                <i className="fa-solid fa-envelope"></i>
              </div>
              <div className="details">
                <span>Email</span>
                <span>name.tutorial@gmail.com</span>
              </div>
            </div>
            <div className="iconGroup">
              <div className="icon">
                <i className="fa-solid fa-location-dot"></i>
              </div>
              <div className="details">
                <span>Location</span>
                <span>X Street, Y Road, San Fransisco</span>
              </div>
            </div>
          </div>
          {/* Contact Info Ends */}

          {/* Social Media Starts */}
          <div className="socialMedia">
            <a href="#"><i className="fa-brands fa-facebook-f"></i></a>
            <a href="#"><i className="fa-brands fa-twitter"></i></a>
            <a href="#"><i className="fa-brands fa-instagram"></i></a>
            <a href="#"><i className="fa-brands fa-linkedin-in"></i></a>
          </div>
          {/* Social Media Ends */}

        </section>
        {/* Left Section (Column) Ends */}

        {/* Right Section (Column) Starts */}
        <section className="col right">

          {/* Form Starts */}
          <form className="messageForm">
            <div className="inputGroup halfWidth">
              <input type="text" name="" required />
              <label>Your Name</label>
            </div>
            <div className="inputGroup halfWidth">
              <input type="email" name="" required />
              <label>Email</label>
            </div>
            <div className="inputGroup fullWidth">
              <input type="text" name="" required />
              <label>Subject</label>
            </div>
            <div className="inputGroup fullWidth">
              <textarea required></textarea>
              <label>Say Something</label>
            </div>
            <div className="inputGroup fullWidth">
              <button>Send Message</button>
            </div>
          </form>
          {/* Form Ends */}

        </section>
        {/* Right Section (Column) Ends */}

      </main>
    </div>


    </>

  );
}

export default ContactUs;
